import StateComponent from './components/StateComponent';
import './App.css';

const App = () => {
  const [inputValue, setInputValue] = useState('');
  const handlePromptSubmit = (value) => {
    setInputValue(value);
  };

  return (
    <div>
      <h1>Data Mahasiswa</h1>
      <StateComponent onsubmit={handlePromptSubmit}/>
      <p>{inputValue}</p>
    </div>
  );
};
export default App;
